Reconozco que no sé completar el poema. Lo que puedo decir es que se trata de un romance histórico con un tono satírico, que hace referencia a la toma de Larache por las tropas españolas en 1610, y juega con un lenguaje humorístico y juegos de palabras. Sin embargo, no conozco la continuación exacta del poema.
